import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 54.1-2101 Real estate salesperson defined.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-2101.md","filePath":"vacode/54.1-2101.md"}'),o={name:"vacode/54.1-2101.md"},s=r('<h1 id="§-54-1-2101-real-estate-salesperson-defined" tabindex="-1">§ 54.1-2101 Real estate salesperson defined. <a class="header-anchor" href="#§-54-1-2101-real-estate-salesperson-defined" aria-label="Permalink to &quot;§ 54.1-2101 Real estate salesperson defined.&quot;">​</a></h1><p>For the purposes of this chapter, &quot;real estate salesperson&quot; means any individual, or business entity, who for compensation or valuable consideration is employed either directly or indirectly by, or affiliated as an independent contractor with, a real estate broker, to sell or offer to sell, or to buy or offer to buy, or to negotiate the purchase, sale or exchange of real estate, or to lease, rent or offer for rent any real estate, or to negotiate leases thereof, or of the improvements thereon.</p><p>Code 1950, § 54-731; 1974, c. 685; 1978, c. 138; 1984, c. 201; 1988, c. 765; 1992, c. 84; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0993" target="_blank" rel="noreferrer">993</a>; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0223" target="_blank" rel="noreferrer">223</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0224" target="_blank" rel="noreferrer">224</a>.</p>',3),n=[s];function i(l,c,d,f,p,_){return t(),a("div",null,n)}const u=e(o,[["render",i]]);export{g as __pageData,u as default};
